import React from "react";

const VideoList = () => {
  return (
<div className="ui items">
  <div className="item">
    <div className="ui tiny image">
      <img alt="alt" src="/images/wireframe/image.png"/>
    </div>
    <div className="middle aligned content">
      <a href="/" className="header">12 Years a Slave</a>
    </div>
  </div>
  </div>
  );
};

export default VideoList;
